자꾸만 눈이 가는 인테리어 소품을 소개해보려고 해요​​​요즘은 분위기 좋은 카페 한 번 가기도 영 마음이 불편하죠​​​​그래서 방 인테리어에 더 신경을 쓰게 되는 것 같아요​귀여운 소품, 예쁜 조명 하나로도방 분위기를 확 바꿀 수 있어요​​​​요즘은 조명 기능 하나만 있는 무드등 보다는다른 기능을 같이 겸하는 무드등을 많이 쓰는 것 같아요​더구나 여름이라 방 냄새에도 더 민감해지는 시기잖아요그래서 디퓨저가 포함된 무드등이란 말에 눈이 갔어요​​​​​​​사이즈도 큰 편이라 포인트 아이템이 되어줄 것 같아요​특대형은 높이가 30cm가 넘는 것도 있으니 놓을 위치를 잘 생각해서 사야할 것 같아요​​​​귀여운 댕냥이들둘 다 집으로 데려오고 싶네요​​​디퓨저는 같이 파는 걸 써도 되고집에 있는 걸 써도 될 것 같아요​​​​​개인적으로는 화이트 머스크 향이 궁금해서 써보고 싶네요 ​페어&프리지아 향도 배 향기가 어떨지 궁금하네요​​​​<판매 페이지 바로가기>​​​​​​​23
